import React from "react";
import { MenuList } from "../data/data";
import Layout from "./../components/Layout/Layout";
import {
  Box,
  Card,
  CardActionArea,
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";


import { useEffect, useState } from "react";
//import "./App.css";

function Menu() {
  const [data, setData] = useState([]);

  const fetchData = () => {
    fetch(`http://127.0.0.1:8000/`)
      .then((response) => response.json())
      .then((actualData) => {
        console.log(actualData);
        setData(actualData.products);
        console.log(data);
      })
      .catch((err) => {
        console.log(err.message);
      });
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="App">
      <tbody>
        <tr>
          <th>Id</th>
          <th>Category</th>
          <th>Item Name</th>
          <th>Item Type</th>
          <th>Quantity</th>
          <th>Price</th>
          <th>Image</th>
          <th>Ratings</th>
        </tr>
        {data.map((item, index) => (
          <tr key={index}>
            <td>{item.id}</td>
            <td>{item.category}</td>
            <td>{item.item_name}</td>
            <td>{item.item_type}</td>
            <td>{item.quantity}</td>
            <td>{item.price}</td>
            <td>
              <img src={'http://localhost:3000/images/'+item.item_image} alt="" height={100} />
            </td>
            <td>{item.rating}</td>

          </tr>
        ))}
      </tbody>
    </div>
  );
}

export default Menu;
